import { ADD_ITEM } from "./actionType";
import store from "../Store";

const addCart = () => {
    const getstate = store.getState().cartReducer
    console.log(getstate.addCart)
    return {
        type: ADD_ITEM,
        payload:2
    };
};



export { addCart };
